import React from 'react';
import { IonPage, IonBackButton, IonButtons, IonToolbar, IonHeader, IonContent, IonIcon, IonTitle, IonLabel } from '@ionic/react';
import tools from '../components/Tools';
import { close } from 'ionicons/icons';


const Help:React.FC = () =>{
    return(
        <IonPage>
            <IonHeader>
                <IonToolbar>
                    <IonButtons hidden={tools.compare(tools.platform(),true,false,true)} onClick={()=>{
                    }} slot="start">
                        <IonBackButton defaultHref=""/>
                    </IonButtons>
                    <IonTitle>About us</IonTitle>
                    <IonButtons hidden={tools.compare(tools.platform(),true,true,false)} slot="end">
                        <IonIcon class="iconStyle onHover" icon={close} onClick={()=>{}}/>
                    </IonButtons>
                </IonToolbar>
            </IonHeader>
            <IonContent>
                <div style={{marginTop:"40%",marginBottom:"40%",textAlign:"center"}}>
                    <IonLabel>Comming soon</IonLabel>
                </div>

            </IonContent>

        </IonPage>
    )
}

export default AboutUs;
